func incremovableSubarrayCount(nums []int) int {
    n := len(nums)
    count := 0

    for start := 0; start < n; start++ {
        for end := start; end < n; end++ {
            // Check if removing subarray [start, end] makes the remaining array strictly increasing
            if isStrictlyIncreasing(nums, start, end) {
                count++
            }
        }
    }

    return count
}

// Helper function to check if the array is strictly increasing
// after removing the subarray from start to end (inclusive).
func isStrictlyIncreasing(nums []int, start int, end int) bool {
    prev := -1 // Start with a number smaller than any element (as nums[i] >= 1)

    // Check the part of the array before the subarray
    for i := 0; i < start; i++ {
        if nums[i] <= prev {
            return false
        }
        prev = nums[i]
    }

    // Check the part of the array after the subarray
    for i := end + 1; i < len(nums); i++ {
        if nums[i] <= prev {
            return false
        }
        prev = nums[i]
    }

    return true
}
